var BdnoneList
  ; (function (a) {
    ; ('use strict')
    console.info('BDGreeder start......')

    // Your code here...
    let timeout = 300

    setTimeout(() => {
      // 搜索条件设置
      a('#tsn_inner').css({ top: '0px' })
      // 模拟点击时间条件
      a('#timeRlt').addClass('active_color_jxNnF')
      a('#timeRlt').find('i').addClass('active_color_jxNnF')
      a('#timeRlt').click()
      // 设置样式
      createStyle(searchStyle())

      BdnoneList = []
      put('.time_pop_1-CDl > div.line_aJk42')
      put('.time_pop_1-CDl .custom_2wanX > div:nth-child(1)')
      //put('#content_right')
      put('#rs_new')
      put('[tpl=recommend_list]') // 移除推荐
      BdnoneList.forEach(el => {
        a(el).remove()
      })

      a('h3.c-title').find('a').attr('style', 'color: #3f64ff;')

      hotSearch()

      console.info('BDGreeder 优化结束')
    }, timeout)
  })(jQuery)

function hotSearch() {
  const top = document.createElement('a')
  top.setAttribute('href', 'https://top.baidu.com/board?platform=pc&sa=pcindex_a_right')
  top.setAttribute('id', 'hotSearch')
  top.innerText = '百度热搜'
  top.append($('.cr-content')[0])
  $('#head').find('.s_form_wrapper').append(top)
}

function put(name) {
  BdnoneList.push(name)
}

function createStyle(css) {
  var el = document.createElement('style')
  el.setAttribute('type', 'text/css')
  el.setAttribute('data-for', 'result')
  el.innerHTML = css
  document.getElementsByTagName('head').item(0).appendChild(el)
}

